import * as React from "react";
import AppBar from "@mui/material/AppBar";
import Box from "@mui/material/Box";
import Toolbar from "@mui/material/Toolbar";
import Typography from "@mui/material/Typography";
import Button from "@mui/material/Button";
import { Theme } from "../Theme";
import './Navbar.css';

const navButtons = [
  { name: "About", id: "about" },
  { name: "Works", id: "works" },
  { name: "Comments", id: "comments" },
  { name: "Concat Us", id: "contact" },
];

const Navbar = () => {
  return (
    
      <AppBar position="fixed"  sx={{ backgroundColor: Theme.colors.deepest }}>
        <Toolbar className="toolbar">
          <Typography
            variant="h6"
            component="h6"
            sx={{ flexGrow: 1, fontSize: 20 }}
          >
            @dincerhuseyiin
          </Typography>
          {navButtons.map((item, i) => (
            <Button className="navButton" sx={{ fontSize: 14 }} color="inherit" key={i}>
              {item.name}
            </Button>
          ))}
        </Toolbar>
      </AppBar>
    
  );
};

export default Navbar;
